CREATE TABLE IF NOT EXISTS data_wifi_ap_log (
    id BIGINT NOT NULL AUTO_INCREMENT,
    ap_mac_address VARCHAR(32),
    ap_name VARCHAR(32),
    ap_ip_address VARCHAR(32),
    ap_group_name VARCHAR(32),
    ap_retry_count BIGINT,
    ap_retry_count_delta BIGINT,
    sub_count INT,
    device_id INT,
    device_name VARCHAR(32),
    device_ip_address VARCHAR(32),
    process_id INT,
    date_created TIMESTAMP DEFAULT NOW(),
    PRIMARY KEY (id),
	INDEX date_created (date_created) USING BTREE,
	INDEX ap_mac (ap_mac_address) USING BTREE,
	INDEX date_created_mac (ap_mac_address, date_created) USING BTREE
);

CREATE TABLE IF NOT EXISTS data_wifi_subscribers_log (
    id BIGINT NOT NULL AUTO_INCREMENT,
    sub_mac_address VARCHAR(32),
    ap_mac_address VARCHAR(32),
    sub_ssid VARCHAR(32),
    sub_rssi INT,
    sub_bytes_rx BIGINT,
    sub_bytes_rx_delta BIGINT,
    sub_bytes_rx_total BIGINT,
    sub_bytes_tx BIGINT,
    sub_bytes_tx_delta BIGINT,
    sub_bytes_tx_total BIGINT,
    sub_snr INT,
    sub_protocol VARCHAR(32),
    sub_vzw_flag INT,
    device_id INT,
    device_name VARCHAR(32),
    device_ip_address VARCHAR(32),
    process_id INT,
    date_created TIMESTAMP DEFAULT NOW(),
    PRIMARY KEY (id),
	INDEX date_created (date_created) USING BTREE,
	INDEX ap_mac (ap_mac_address) USING BTREE,
	INDEX date_created_mac (ap_mac_address, date_created) USING BTREE
);

