-- update the old wifi tables just in case we use the controllers again
drop procedure if exists update_wifi_old;

delimiter //
create procedure update_wifi_old()
begin

	set @db = (SELECT DATABASE());
	set @cn = 'id';

    set @tn = 'data_wifi_ap_log';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

	if (@cat IS NOT NULL and @tn = 'data_wifi_ap_log') then
		alter table data_wifi_ap_log drop column id;
		alter table data_wifi_ap_log add primary key(ap_mac_address, date_created);
	end if;

    set @tn = 'data_wifi_subscribers_log';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

	if (@cat IS NOT NULL and @tn = 'data_wifi_subscribers_log') then
		alter table data_wifi_subscribers_log drop column id;
		alter table data_wifi_subscribers_log add primary key(sub_mac_address, date_created);
	end if;

end//

delimiter ';'
call update_wifi_old();

