drop procedure if exists update_wifi_old;

delimiter //
create procedure update_wifi_old()
begin

	set @db = (SELECT DATABASE());

    -- add a second key for elevated priveldge ability
    set @cn = 'cli_key_two';
    set @tn = 'data_wifi_devices';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

	if (@cat IS NULL and @tn = 'data_wifi_devices') then
		alter table data_wifi_devices add column cli_key_two varchar(128) after cli_key;
        update data_wifi_devices set cli_key_two = cli_key;
	end if;

    -- add a flag that allows us to swap the rx tx values on scan time
    set @cn = 'dataflow_swap';
    set @tn = 'data_wifi_backhaul_limit';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

	if (@cat IS NULL and @tn = 'data_wifi_backhaul_limit') then
		alter table data_wifi_backhaul_limit add column dataflow_swap INT after if_name;
		update data_wifi_backhaul_limit set dataflow_swap = 0;
	end if;

    -- add totals in case of weird counts that need to operate similar to backhaul
    set @cn = 'client_count_total';
    set @tn = 'data_wifi_counts';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

    if (@cat IS NULL and @tn = 'data_wifi_counts') then
		alter table data_wifi_counts add column client_count_total BIGINT after client_count;
		alter table data_wifi_counts add column ports_in_use_count_total BIGINT after ports_in_use_count;
	end if;

end//

delimiter ';'
call update_wifi_old();

