-- Remove invalid duplicate alarm control entries so that unique index can be added
DELETE FROM css_networking_alarm_control
WHERE id NOT IN(
    SELECT id FROM (
        SELECT DISTINCT id, target_type, target_id, alarm_text, alarm_text_hash, alarm_severity
            FROM css_networking_alarm_control
        GROUP BY target_type, target_id, alarm_text, alarm_text_hash, alarm_severity
    ) as tmp
);

-- Add unique index to prevent duplicate alarm control entries from being added
SET @s = (SELECT IF(
    (SELECT COUNT(*)
        FROM INFORMATION_SCHEMA.STATISTICS
        WHERE table_name = 'css_networking_alarm_control'
        AND table_schema = DATABASE()
        AND index_name = 'idx_css_networking_alarm_control_unique'
    ) > 0,
    "SELECT 1",
    "ALTER TABLE css_networking_alarm_control ADD UNIQUE KEY idx_css_networking_alarm_control_unique
    (target_type, target_id, alarm_text, alarm_text_hash, alarm_severity) USING BTREE;"
));

PREPARE stmt FROM @s;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;


