-- All the ADRF EPOCH M1P devices built by or before 9-20-2012 doesnt change device status even if the device is removed or unreachable.
-- The root cause for this issue  is because the old driver set alarm_exempt and offline_alarm_exempt in device table to a value other than 0

UPDATE css_networking_device
SET alarm_exempt = 0 , offline_alarm_exempt = 0
WHERE type_id = 124;
-- add Main Device Name to data_microwave Table

SET @s = (SELECT IF(
    (SELECT COUNT(*)
        FROM INFORMATION_SCHEMA.COLUMNS
        WHERE table_name = 'data_microwave'
        AND table_schema = DATABASE()
        AND column_name = 'main_device_name'
    ) > 0,
    "SELECT 1",
    "ALTER TABLE data_microwave ADD COLUMN main_device_name VARCHAR( 255 ) NULL"
));

PREPARE stmt FROM @s;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

