/*
Table structures for new device type filter tree
*/

SET FOREIGN_KEY_CHECKS=0;

-- ----------------------------
-- Table structure for def_device_filter_tree
-- ----------------------------
DROP TABLE IF EXISTS def_device_filter_tree;
CREATE TABLE def_device_filter_tree (
  id int(10) NOT NULL AUTO_INCREMENT,
  name varchar(255) NOT NULL,
  path varchar(1000) NOT NULL,
  parent_id int(10) NOT NULL,
  ui varchar(1000) DEFAULT NULL,
  PRIMARY KEY (id)
) ENGINE=InnoDB AUTO_INCREMENT=134 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of def_device_filter_tree
-- ----------------------------







-- ----------------------------
-- Table structure for def_device_filter_map
-- ----------------------------
DROP TABLE IF EXISTS def_device_filter_map;
CREATE TABLE def_device_filter_map (
  id int(10) NOT NULL AUTO_INCREMENT,
  device_type_id int(10) NOT NULL,
  config_id int(10) NOT NULL,
  PRIMARY KEY (id),
  KEY idx_css_networking_device_type_id (device_type_id) USING BTREE,
  KEY idx_config_id (config_id),
  CONSTRAINT fk_config_id_device_filter_tree FOREIGN KEY (config_id) REFERENCES def_device_filter_tree (id),
  CONSTRAINT fk_device_type_id_css_networking_device_type FOREIGN KEY (device_type_id) REFERENCES css_networking_device_type (id)
) ENGINE=InnoDB AUTO_INCREMENT=853 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of def_device_filter_map
-- ----------------------------





-- ----------------------------
-- Table structure for def_device_filter_custom
-- ----------------------------
DROP TABLE IF EXISTS def_device_filter_custom;
CREATE TABLE def_device_filter_custom (
  id int(10) NOT NULL AUTO_INCREMENT,
  config_id int(10) NOT NULL,
  ref_id int(10) NOT NULL,
  name varchar(255) NOT NULL,
  type varchar(255) DEFAULT NULL,
  props varchar(2000) DEFAULT NULL,
  PRIMARY KEY (id),
  KEY fk_config_id_def_device_filter_tree (config_id),
  CONSTRAINT fk_config_id_def_device_filter_tree FOREIGN KEY (config_id) REFERENCES def_device_filter_tree (id)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of def_device_filter_custom
-- ----------------------------

UPDATE css_networking_device_alarm
SET severity_id = 1
WHERE id IN (SELECT id FROM
			(
				SELECT da.id FROM
				css_networking_device_alarm da
				WHERE  da.description LIKE 'R2R%' AND da.cleared IS NULL
			) a
	);


-- Remove old Teko alarm descriptions

DELETE ad.*
FROM css_alarms_dictionary ad
INNER JOIN css_networking_device_type dt ON ad.device_type_id = dt.id AND dt.vendor = "Teko"
WHERE ad.alarm_description = "Auto power-off";

DELETE ad.*
FROM css_alarms_dictionary ad
INNER JOIN css_networking_device_type dt ON ad.device_type_id = dt.id AND dt.vendor = "Teko"
WHERE ad.alarm_description LIKE "The Module operating temperature is too high%";

DELETE ad.*
FROM css_alarms_dictionary ad
INNER JOIN css_networking_device_type dt ON ad.device_type_id = dt.id AND dt.vendor = "Teko"
WHERE ad.alarm_description LIKE "The Module operating temperature is too low%";

DELETE ad.*
FROM css_alarms_dictionary ad
INNER JOIN css_networking_device_type dt ON ad.device_type_id = dt.id AND dt.vendor = "Teko"
WHERE ad.alarm_description LIKE "Received optical power%is slightly out of range%";

DELETE ad.*
FROM css_alarms_dictionary ad
INNER JOIN css_networking_device_type dt ON ad.device_type_id = dt.id AND dt.vendor = "Teko"
WHERE ad.alarm_description LIKE "Received optical power exeeds%";


DELETE FROM log_ticketing_notification_queue WHERE sent is NULL AND cleared = 0 AND send_date < now() AND recurrence = 0;
-- Bug 7441: Updating driver file and class names to meet PSR standards
UPDATE css_networking_device_type SET build_file='MultitechRCell100BuilderLauncher.php', scan_file='MultitechRCell100AlarmScannerLauncher.php',
prop_scan_file='MultitechRCell100PropScannerLauncher.php', controller_file='MultitechRCell100Controller.php'
WHERE (id=90);

-- Updating telnet ports for Multitech to be SSH
UPDATE css_networking_device_port_def
SET variable_name = 'ssh', name = 'SSH', default_port = 22
WHERE device_type_id = 90 AND variable_name = 'ssh' AND name = 'SSH' AND default_port <> 22;

-- Updating default port entries
UPDATE css_networking_device_port dp
SET port = 22
WHERE port = 5000 AND port_def_id = (
	SELECT id
	FROM css_networking_device_port_def
	WHERE variable_name = 'ssh' AND name = 'SSH' AND device_type_id = 90
);


