drop procedure if exists update_wifi;

delimiter //
create procedure update_wifi()
begin

	set @db = (SELECT DATABASE());

    -- add sp parent node_id coulmn to venue table
    set @cn = 'sp_parent_node_id';
    set @tn = 'data_wifi_venues';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

	if (@cat IS NULL and @tn = 'data_wifi_venues') then
		alter table data_wifi_venues add column sp_parent_node_id INT;
	end if;

	-- repair column spelling error
    set @cn = 'capacitiy_limit';
    set @tn = 'data_wifi_limits';
	set @cat = (	SELECT COLUMN_NAME
					FROM INFORMATION_SCHEMA.COLUMNS
					WHERE table_schema = @db
                    AND table_name = @tn
					AND column_name = @cn);

	if (@cat IS NOT NULL and @tn = 'data_wifi_limits') then
		alter table data_wifi_limits CHANGE capacitiy_limit capacity_limit INT;
	end if;

end//

delimiter ';'
call update_wifi();

