DELIMITER $$

-- increase size of field timestamp in the data_networking_siteportal_device to bigint
-- to be able to handle sequence number for property logs (timestamp+propId)
ALTER TABLE data_networking_siteportal_device MODIFY timestamp bigint$$

DROP PROCEDURE IF EXISTS add_alarms_sequence_table$$
